import './Header.css';
import logo from "../../asstes/images/BCCI-Logo.png";
const Headr = () => {
  return (
    <nav class="navbar bg-body-tertiary">
      <div class="container-fluid">
        <a class="navbar-brand">
            <img src={logo} alt='' width="40" height="40" className="ms-5"/>
            <span className="fw-bold ms-3">BCCI.TV</span>
        </a>
        <div>
          <i class="fa-brands fa-instagram p-2"></i>
          <i class="fa-brands fa-facebook p-2"></i>
          <i class="fa-solid fa-xmark p-2"></i>
          <li class="follow-us text-black">Follow us</li>
        </div>
      </div>
    </nav>
  );
};
export default Headr;
